const Intro = () => {
    return (
        <div className="intro">
            <article className="intro__subtext">Chalita Ndunu</article>
            <h1 className="intro__heading">Software Engineering student.<br> Full stack JavaScript developer.</br></h1>
            {/* <h1 className="intro__heading"></h1> */}
        </div>
    );
};

export default Intro;
